function initRegion(map) {
	let points = [];
	for (let i = 0; i < region.length; i++) {
		var lnglats = region[i].split(',');
		points = [];
		for (let j = 0; j < lnglats.length; j++) {
			let lnglat = lnglats[j].split(' ');
			points.push(new T.LngLat(lnglat[0], lnglat[1]));
		}
		let polygon = new T.Polygon(points, {
			color: "rgb(91,134,229)", weight: 2, opacity: 1, fillColor: "rgb(91,134,229)", fillOpacity: 0.1
		});
		polygon.addEventListener('mouseover', function (e) {
			let that = e.target;
			that.setWeight(5);
			that.setFillOpacity(0.3);
		}).addEventListener('mouseout', function (e) {
			let that = e.target;
			that.setWeight(2);
			that.setFillOpacity(0.1);
		});
		map.addOverLay(polygon);
	}
}
function clusterPoints(lnglatStr, map,siteNames) {
	var siteName = siteNames.split(",");
	let lnglats = [];
	let lnglatArr = lnglatStr.split('@');
	for (let i = 0; i < lnglatArr.length; i++) {
		let temp = lnglatArr[i].split(',');
		lnglats.push(new T.Marker(new T.LngLat(temp[0], temp[1]), { title: siteName[i] }));
	}
	new T.MarkerClusterer(map, {
		markers: lnglats,
		styles: [
			{
				url: 'img/position.png',
				size: [30, 30], //图片大小
				// offset: new T.Point(-15, -15), //显示图片的偏移量
				textColor: '#fff', //显示数字的颜色
				textSize: 8,//显示文字的大小
				range: [0, 50],
			}, {
				url: '/img/position.png',
				size: [40, 40],
				textColor: '#fff',
				textSize: 10,
				range: [51, 400],
			}, {
				url: '/img/position.png',
				size: [50, 50],
				textColor: '#fff',
				textSize: 12,
				range: [401, 1000],
			}
		]
	});
}
